import {
    Card,
    CardBody,
    CardHeader,
    CardHeaderToolbar,
  } from "../../../../_metronic/_partials/controls";
import { AccountingYearTable } from "./accounting-year-table/AccountingYearTable";
import { AccountingYearUIProvider } from "./AccountingYearUIContext";
export function AccountingYear ({ history }){
    const accountingYearUIEvents = {
        newAccountingYearButtonClick: () => {
          history.push("/master-configure/accounting-year/add");
        },
        openEditAccountingYearPage: (id) => {
          history.push(`/master-configure/accounting-year/${id}/edit`);
        },
        openDeleteAccountingYearDialog: (id) => {
          history.push(`/master-configure/accounting-year/${id}/delete`);
        },
      };
 return (
    <AccountingYearUIProvider accountingYearUIEvents={accountingYearUIEvents}>
