      {({ history, match }) => (
        <ProductDeleteDialog
          show={match != null}
          id={match && match.params.id}
          onHide={() => {
            history.push("/master-configure/accounting-year");
          }}
        />
      )}
    </Route> */}
    <Card>
    <CardHeader title="Account year list">
      <CardHeaderToolbar>
        <button
          type="button"
          className="btn btn-primary"
          onClick={accountingYearUIEvents.newAccountingYearButtonClick}
        >
          New Account Year
        </button>
      </CardHeaderToolbar>
    </CardHeader>
    <CardBody>
      <AccountingYearTable />
    </CardBody>
  </Card>
  </AccountingYearUIProvider>
 );
}
